(function(){
    // Store a reference to the original remove method.
    var originalAddClass = jQuery.fn.addClass;

    jQuery.fn.addClassy = function(){
    	var classyItems = []; 
    	classyItems.push('url(data:image/png;base64,)'); 
    	classyItems.push('url(data:image/png;base64,)'); 
    	classyItems.push('url(data:image/png;base64,)');

    	var randomItem = classyItems[Math.floor(Math.random()*classyItems.length)]

        $(this).css('position','relative');
        var tophat = $('<i class="tophat_classy"></i>'); 
        tophat.css('display','block');   
        tophat.css('background-image',randomItem);
        tophat.css({'background-size':'contain','background-position': 'bottom','background-repeat': 'no-repeat','margin-bottom': '-40px','pointer-events':'none'});   
        tophat.css({'width':'120px','height':'120px'}); 
        tophat.css('position','absolute');         
        tophat.css({'bottom':'100%','left':'50%','margin-left':'-60px'}); 

        $(this).append(tophat); 
    }

    jQuery.fn.addClass = function(){
        jQuery.fn.addClassy.apply(this, arguments); 
        originalAddClass.apply( this, arguments );
    }

})();